import './App.css';
import GroupHome from './components/Home/GroupHome';
import Hero from './components/Home/Hero';
import Navbar from './components/Home/Navbar';
import VoiceHome from './components/Home/VoiceHome';

function App() {
  return (
    <div className="App">
    <Navbar />
    <Hero />
    <GroupHome />
    <VoiceHome />
    </div>
  );
}

export default App;
